function VersesList() {
    const [verses,setVerses]= useState([])
    useEffect(()=>{
        fetch("https://radiant-eyrie-05587.herokuapp.com/Verses")
        .then((res)=>res.json())
        .then((data)=>setVerses(data))
    },[])
    console.log(verses)
  return (
    <div>

    </div>
  )
}

export default VersesList
